/* -- The root styles must go in the element of the structure with the name "Hero". --*/
.hero-56 {
  --hero-56-speed-animation: 75s;

  /* Row left styles */
  .hero-56__row:first-child{    
    .hero-56__row-img {
      animation-name: hero-56-horizontal-scroll-rtl;
      animation-duration: var(--hero-56-speed-animation);
      animation-iteration-count: infinite;
      animation-timing-function: linear;

      .hero-56__img-wrapper{
        margin-right: var(--space-m);

        /* Tablet styles */
        @media(max-width: 991px){
          margin-right: var(--space-s);
        }
      }
    }
  }

  /* Row right styles */
  .hero-56__row:last-child{
    .hero-56__row-img{
      animation-name: hero-56-horizontal-scroll-ltr;
      animation-duration: var(--hero-56-speed-animation);
      animation-iteration-count: infinite;
      animation-timing-function: linear;

      .hero-56__img-wrapper{
        margin-left: var(--space-m);

        /* Tablet styles */
        @media(max-width: 991px){
          margin-left: var(--space-s);
        }
      }
    }
  }
}
/*-- Animation right to left --*/
@keyframes hero-56-horizontal-scroll-rtl {
  from {transform: translateX(0%);}
  to {transform: translateX(-100%);}
}

/*-- Animation left to right --*/
@keyframes hero-56-horizontal-scroll-ltr {
  from {transform: translateX(-100%);}
  to {transform: translateX(0%);}
}
